mx=0
my=0

p={
 x=1*8,
 y=9*8,
 s=320,
 f=0
}

lastx=239

vw=30
vh=16

vwh=vw/2
vhh=vh/2

function TIC()

	function move(dx,dy)
	  local nx=p.x+dx
			--nx=nx%239*8
	  local ny=p.y+dy
		 if not fget(mget(nx,ny),0) then
		  p.x=nx
		  p.y=ny
		 end
	 end

	if btnp(0) then move(0,-8) end
	if btnp(1) then move(0,8) end
	if btn(2) then move(-1,0) end
	if btn(3) then move(1,0) end

	cls(1)
	local mx=math.min(lastx-vw,math.max(0,p.x/8-vwh))
	--mx=p.x/8-vwh
	map(0,68,30,17,0,0,15) --sky
	map(0,102,30,17,0,0,15) --bushes
	map(0,119,30,17,0,0,15) --rocks
	map(mx,my,30,17,0,0,15) --main
	map(mx,my+85,30,17,0,0,15) --overlay
	spr(p.s,(p.x-mx*8),(p.y-my*8),15,1,p.f,0,2,4)	
end

